import "./App.css";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import About from "./components/About";
import { Switch } from "react-router-dom";
import { Route } from "react-router-dom";

function App() {
  return (
    <>
      <Switch>
        <Navbar />
        <div className="App">
          <Route path="/" exact>
            <Home />
          </Route>
          <Route path="/about" exact>
            <About />
          </Route>
        </div>
      </Switch>
    </>
  );
}

export default App;
